export default function TodoLayouts() {
  return (
    <ThemeContextProvider >
      <Header />
      <Paper sx={{mb:5}} elevation={0} className='main-section app-container ' >
        <Suspense fallback={<div>...</div>}>
          <Outlet />
        </Suspense>
      </Paper>
    </ThemeContextProvider>
  );
}
